4:07','',149,'https://wordpress-819206-3321823.cloudwaysapps.com/?p=222',0,'revision','',0),(223,1,'2023-03-14 16:30:31','2023-03-14 16:30:31','<!-- wp:paragraph -->\n<p>Mollie Ritchie is a nurse practitioner who works for Emergency Medicine Specialists group. In her role, she serves all the emergency rooms for Ascension in southeastern Wisconsin. In her career, she has served as a trauma coordinator, EMS liaison, and has fostered relationships between local police and fire departments.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While pregnant with her third child she went back to school and completed her masters degree, graduating in 2016. The start of 2017 was especially challenging as she was diagnosed with thyroid cancer, but according to her husband Aaron, â€œthis didnâ€™t slow her down one bitâ€.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"\" target=\"_blank\" rel=\"noreferrer noopener\">Listen Here</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":224,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://wordpress-819206-3321823.cloudwaysapps.com/wp-content/uploads/2023/03/Mollie-Ritchie_Hero-892x1024.jpg\" alt=\"\" class=\"wp-image-224\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Salute to Service (WTMJ Radio) Mollie Richie Interview','Mollie Ritchie is a nurse practitioner who works for Emergency Medicine Specialists group','publish','open','open','','salute-to-service-wtmj-radio-mollie-richie-interview','','','2023-03-14 16:32:57','2023-03-14 16:32:57','',0,'https://wordpress-819206-3321823.cloudwaysapps.com/?p=223',0,'post','',0),(224,1,'2023-03-14 16:29:07','2023-03-14 16:29:07','','Mollie-Ritchie_Hero','','inherit','open','closed','','mollie-ritchie_hero','','','2023-03-14 16:29:07','2023-03-14 16:29:07','',223,'https://wordpress-819206-3321823.cloudwaysapps.com/wp-content/uploads/2023/03/Mollie-Ritchie_Hero.jpg',0,'attachment','image/jpeg',0),(225,1,'2023-03-14 16:30:00','2023-03-14 16:30:00','','Rezmer photo','','inherit','open','closed','','rezmer-photo','','','2023-03-14 16:30:07','2023-03-14 16:30:07','',223,'https://wordpress-819206-3321823.cloudwaysapps.com/wp-content/uploads/2023/03/Rezmer-photo.png',0,'attachment','image/png',0),(226,1,'2023-03-14 16:30:31','2023-03-14 16:30:31','<!-- wp:paragraph -->\n<p>Mollie Ritchie is a nurse practitioner who works for Emergency Medicine Specialists group. In her role, she serves all the emergency rooms for Ascension in southeastern Wisconsin. In her career, she has served as a trauma coordinator, EMS liaison, and has fostered relationships between local police and fire departments.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While pregnant with her third child she went back to school and completed her masters degree, graduating in 2016. The start of 2017 was especially challenging as she was diagnosed with thyroid cancer, but according to her husband Aaron, â€œthis didnâ€™t slow her down one bitâ€.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"\" target=\"_blank\" rel=\"noreferrer noopener\">Listen Here</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->\n\n<!-- wp:paragraph -->\n<p>We are <em>proud </em>to recognize the recipient of the High Five Award, <strong>Jessica Rezmer, DO - Emergency Medicine&nbsp;</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dr. Rezmer joins the ranks of an exceptional group of associates previously selected&nbsp; as recipients for the High Five Award.&nbsp;</p>\n<!-- /wp:paragraph -->\n\