ms and conditions are governed by the laws of the United States of America and the laws of the State of Wisconsin.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>CONTACT INFORMATION</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Emergency Medicine Specialists, S.C.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Mailing address:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>10625 West North Avenue<br>Suite 102<br>Wauwatosa, Wisconsin 53226</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact Email: information@ems-wi.com,All Rights Reserved.</p>\n<!-- /wp:paragraph -->','TERMS OF USE','','inherit','closed','closed','','237-revision-v1','','','2023-03-14 16:48:18','2023-03-14 16:48:18','',237,'https://wordpress-819206-3321823.cloudwaysapps.com/?p=241',0,'revision','',0),(242,1,'2023-03-14 16:49:14','2023-03-14 16:49:14','<!-- wp:paragraph -->\n<p>Welcome to https://www.ems-wi.com (the â€œSiteâ€).We understand that privacy online is important to users of our Site, especially when conducting business.This statement governs our privacy policies with respect to those users of the Site (â€œVisitorsâ€) who visit without transacting business and Visitors who register to transact business on the Site and make use of the various services offered by (collectively, â€œServicesâ€) (â€œAuthorized Customersâ€).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>â€œPersonally Identifiable Informationâ€</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>refers to any information that identifies or can be used to identify, contact, or locate the person to whom such information pertains, including, but not limited to, name, address, phone number, fax number, email address, financial profiles, social security number, and credit card information. Personally Identifiable Information does not include information that is collected anonymously (that is, without identification of the individual user) or demographic information not connected to an identified individual.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>What Personally Identifiable Information is collected?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may collect basic user profile information from all of our Visitors. We collect the following additional information from our Authorized Customers: the names, addresses, phone numbers and email addresses of Authorized Customers, the nature and size of the business, and the nature and size of the advertising inventory that the Authorized Customer intends to purchase or sell.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>What organizations are collecting the information?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In addition to our direct collection of information, our third party service vendors (such as credit card companies, clearinghouses and banks) who may provide such services as credit, insurance, and escrow services may collect this information from our Visitors and Authorized Customers. We do not control how these third parties use such information, but we do ask them to disclose how they use personal information provided to them from Visitors and Authorized Customers. Some of these third parties may be intermediaries that act solely as links in the distribution chain, and do not store, retain, or use the information given to them.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>How does the Site use Personally Identifiable Information?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use Personally Identifiable Information to customize the Site, to make appropriate service offerings, and to fulfill buying and selling requests on the Site. We may email Visitors and Authorized Customers about research or purchase and selling opportunities on the Site or information related to the subject matter of the Site. We may also use Personally Identifiable Information to contact Visitors and Authorized Customers in response to specific inquiries, or to provide requested information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>With whom may the information may be shared?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Personally Identifiable Information about Authorized Customers may be shared with other Authorized Customers who wish to evaluate potential transactions with other Authorized Customers. We may share aggregated information about our Visitors, including the demographics of our Visitors and Authorized Customers, with our affiliated agencies and third party vendors. We also offer the opportunity to â€œopt outâ€ of receiving information or being contacted by us or by any agency acting on our behalf.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>How is Personally Identifiable Information stored?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Personally Identifiable Information collected by is securely stored and is not accessible to third parties or employees of except for use as indicated above.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>What choices are available to Visitors regarding collection, use and distribution of the information?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Visitors and Authorized Customers may opt out of receiving unsolicited information from or being contacted by us and/or our vendors and affiliated agencies by responding to emails as instructed, or by contacting us at</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cookies</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A cookie is a string of information that a website stores on a visitorâ€™s computer, and that the visitorâ€™s browser provides to the website each time the visitor returns.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Are Cookies Used on the Site?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cookies are used for a variety of reasons. We use Cookies to obtain information about the preferences of our Visitors and the services they select. We also use Cookies for security purposes to protect our Authorized Customers. For example, if an Authorized Customer is logged on and the site is unused for more than 10 minutes, we will automatically log the Authorized Customer off. Visitors who do not wish to have cookies placed on their computers should set their browsers to refuse cookies before using https://www.ems-wi.com, with the drawback that certain features of website may not function properly without the aid of cookies.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Cookies used by our service providers</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our service providers use cookies and those cookies may be stored on your computer when you visit our website. You can find more details about which cookies are used in our cookies info page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>How does use login information?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>uses login information, including, but not limited to, IP addresses, ISPs, and browser types, to analyze trends, administer the Site, track a userâ€™s movement and use, and gather broad demographic information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>What partners or service providers have access to Personally Identifiable Information from Visitors and/or Authorized Customers on the Site?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>has entered into and will continue to enter into partnerships and other affiliations with a number of vendors.Such vendors may have access to certain Personally Identifiable Information on a need to know basis for evaluating Authorized Customers for service eligibility. Our privacy policy does not cover their collection or use of this information. Disclosure of Personally Identifiable Information to comply with law. We will disclose Personally Identifiable Information in order to comply with a court order or subpoena or a request from a law enforcement agency to release information. We will also disclose Personally Identifiable Information when reasonably necessary to protect the safety of our Visitors and Authorized Customers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>How does the Site keep Personally Identifiable Information secure?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>All of our employees are familiar with our security policy and practices. The Personally Identifiable Information of our Visitors and Authorized Customers is only accessible to a limited number of qualified employees who are given a password in order to gain access to the information. We audit our security systems and processes on a regular basis. Sensitive information, such as credit card numbers or social security numbers, is protected by encryption protocols, in place to protect information sent over the Internet. While we take commercially reasonable measures to maintain a secure site, electronic communications and databases are subject to errors, tampering and break-ins, and we cannot guarantee or warrant that such events will not take place and we will not be liable to Visitors or Authorized Customers for any such occurrences.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>How can Visitors correct any inaccuracies in Personally Identifiable Information?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Visitors and Authorized Customers may contact us to update Personally Identifiable Information about them or to correct any inaccuracies by emailing us at information@ems-wi.com</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Can a Visitor delete or deactivate Personally Identifiable Information collected by the Site?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are acting as a data controller with respect to the personal data of our website visitors. You can request â€œto be forgottenâ€. We provide Visitors and Authorized Customers with a mechanism to delete/deactivate Personally Identifiable Information from the Siteâ€™s database by contacting . However, because of backups and records of deletions, it may be impossible to delete a Visitorâ€™s entry without retaining some residual information. An individual who requests to have Personally Identifiable Information deactivated will have this information functionally deleted, and we will not sell, transfer, or use Personally Identifiable Information relating to that individual in any way moving forward.Visitors and Authorized Customers may contact us at information@ems-wi.com</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Your rights</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>These are summarized rights that you have under data protection law</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>The right to access</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>The right to rectification</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>The right to erasure</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>The right to restrict processing</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>The right to object to processing</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>The right to data portability</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>The right to complain to a supervisory authority</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>The right to withdraw consent</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>What happens if the Privacy Policy Changes?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will let our Visitors and Authorized Customers know about changes to our privacy policy by posting such changes on the Site. However, if we are changing our privacy policy in a manner that might cause disclosure of Personally Identifiable Information that a Visitor or Authorized Customer has previously requested not be disclosed, we will contact such Visitor or Authorized Customer to allow such Visitor or Authorized Customer to prevent such disclosure.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Links:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>https://www.ems-wi.com contains links to other web sites. Please note that when you click on one of these links, you are moving to another web site. We encourage you to read the privacy statements of these linked sites as their privacy policies may differ from ours.</p>\n<!-- /wp:paragraph -->','PRIVACY POLICY','','publish','closed','closed','','privacy-policy','','','2023-03-14 17:25:17','2023-03-14 17:25:17','',0,'https://wordpress-819206-3321823.cloudwaysapps.com/?page_id=242',0,'page','',0),(243,1,'2023-03-14 16:49:14','2023-03-14 16:49:14','<!-- wp:paragraph -->\n<p>Welcome to https://www.ems-wi.com (the â€œSiteâ€).We understand that privacy online is important to users of our Site, especially when conducting business.This statement governs our privacy policies with respect to those users of the Site (â€œVisitorsâ€) who visit without transacting business and Visitors who register to transact business on the Site and make use of the various services offered by (collectively, â€œServicesâ€) (â€œAuthorized Customersâ€).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>â€œPersonally Identifiable Informationâ€</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>refers to any information that identifies or can be used to identify, contact, or locate the person to whom such information pertains, including, b